export const getCurrentTime = () => {
  let date = new Date();
  let minutes = date.getMinutes();
  let hours = date.getHours();
  let day = date.getDate();
  let month = getMonth();

  if (minutes < 10) {
    minutes = "0" + minutes;
  }

  if (hours < 10) {
    hours = "0" + hours;
  }

  if (day < 10) {
    day = "0" + day;
  }

  if (month < 10) {
    month = "0" + month;
  }

  let currentTime = day + "/" + month + " at " + hours + ":" + minutes;

  return currentTime;
};

export const getMonth = () => {
  let date = new Date();

  let month = date.getMonth() + 1;

  if (month < 10) {
    month = "0" + month;
  }

  return month;
};
